This all-electric Mustang Cobra Jet 1400 was built for drag racing without using a drop of fuel. In tests this week the battery powered prototype blitzed the quarter-mile in 8,27 seconds at 270 km/h. The car also managed a peak of over 1 100 kW on the wheels, somewhat more than the 1 000 kW the development team planned. The Cobra Jet 1400 is powered by four motors spinning at up to 10 000 r/min. These motor-inverters have a maximum output of 350 kW per motor.

But if you don't believe us, catch the debut of the all-electric Mustang Cobra Jet 1400 at an NHRA drag racing event in the US this weekend.

@fordperformance has not finished pushing the boundaries yet and have said that they are only scratching the surface of what they may be able to achieve with this much electric horsepower in a drag racing setting. They are interested to continue working with @nhra to determine how electrification can be part of the sport.

Who knows what may be possible in high-performance all-electric vehicles for Ford going forward? #pushingthelimits #pushingboundaries #carswithoutlimits
