ℹ️ El Aston Martin Lagonda Vignale es un concept car de cinco plazas construido por Ghia para Lagonda . Fue diseñado por Moray Callum en Ghia y presentado en 1993 en el Salón del Automóvil de Ginebra junto con el Aston Martin DB7 , diseñado por el hermano mayor de Moray, Ian Callum . [1] Construido para medir el interés por un modelo Aston Martin de 4 puertas, el concepto fue bien recibido, pero nunca entró en producción ya que Ford decidió que la marca Lagonda sería demasiado cara para revivir debido a su relativa oscuridad fuera del Reino Unido
ℹ️El cuerpo del Lagonda Vignale está hecho de materiales compuestos y cuenta con molduras de níquel en lugar de cromo para aprovechar los tonos sutiles que se encuentran en el níquel.
